import React from 'react';
import About from './About';
import Contact from './Contact';
import Services from './Services';
import { NavLink } from 'react-router-dom';

const Home = () => {
    return(
        <div>
            <section id='home'>
                <div className='container'>
                    <div className='row justify-content-center'>
                        <div className='col-md-8 mt-5'>
                            <h1 className='display-4 fw-bolder mb-4 text-center text-white'> Create, curate, teach. That’s the way we share</h1>
                            <p className='lead text-center fs-4 mb-5 text-white'>"I obsess over the challenges of content 
                            organization. I’m discovering that digital methodology which is essential to make a content useful. 
                            You can create, Curate and Share the notes with the Students.   
                            Let me show you".</p>
                            <div className='buttons d-flex justtify-content-center'>
                                <NavLink to = "/contact" className= "btn btn-light me-4 rounded-pill px-4 py-2">Get Quote</NavLink>
                                <NavLink to = "/service" className= "btn btn-light me-4 rounded-pill px-4 py-2">Our Services</NavLink>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
            <About/>
            <Services/>
            <Contact/>
        </div>
    )
}

export default Home;
